import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";

import "./App.css";
import Header from "./Components/Header/Header";

import Topstories from "./Components/Home/topstories";




const App = () => {
  return (
    <div>
      <BrowserRouter>
      <Header/>
      <Routes>
      <Route path='/' ho></Route>
      </Routes>
      </BrowserRouter>
      <div></div>
      <div><Topstories/></div>
    </div>
  );
};

export default App;
